import React, { useState } from "react";
import './App.css';

const App = () =>{
    const purple="#8e44ad";
    const [bg, setBg]= useState(purple);

    const bgChange= () =>
    {
        let yellow="#fce605";
        setBg(yellow);

    }
    return(
         <>
         <div style={{backgroundColor: bg, paddingBottom:'350px'}}>
             <button onClick={bgChange}>Click Me</button>
         </div>

         </>

    );

}
export default App;
